import "./style.css";
export default function SearchResults({ results }){
    return(
        <div className="search-results">
            <div  className="search-items">
                {!result?.length && <p>No existen resutados</p>}

                {results?.map((value)=>{
            return(
                <div  key={value.id}>
                    <p>{value.name}</p>
                    <p>{value.email}</p>
                </div>
                    );
                })}
          </div>
        </div>
    );
}
